import React from 'react';
import '../../Styles/Insights.css';
import ProgressCircle from './ProgressCircle';

const Insights = () => {
  return (
    <div className='insights'>
      <div className="insights_container">
        <h3>Hello <strong>User</strong></h3>
      </div>
      <div className='insights_container'>
        <ProgressCircle />
        <ProgressCircle />
      </div>
    </div>
  )
};

export default Insights
